  margin-top: 10vw;
  position: relative;
  display: flex;
  flex-direction: column;
  margin-left: 5vw;
  background-color: black;
  width: 90vw;
  .searchBar {
    display: flex;
    padding: 2vw;
    background-color: beige;
    width: 50vw;
    .icon {
      height: 50px;
      width: 50px;
      max-height: 50px;
      max-width: 50px;
      background-color: aqua;
      margin-right: 3vw;
      border-radius: 100%;
    }
  }
  .suggest {
    height: auto;
    width: 50vw;
    background-color: blue;
    height: auto;
    display: flex;
    flex-direction: column;
    .result {
      padding: 1vw;
      background-color: brown;
      font-size: 24px;
      span {
        font-size: 20px;
      }
    }
  }
`;

